INSERT INTO `articles` VALUES
(7,4,2,'Gerak Cepat LAZISNU Balongbendo: Serahkan Bantuan Kursi Roda untuk Adek Ozzi di Temenggungan Balongbendo','gerak-cepat-lazisnu-balongbendo-serahkan-bantuan-kursi-roda-untuk-adek-ozzi-di-temenggungan-balongbendo','MISBAKHUL MUNIR','/storage/uploads/articles/1765448807_aBfpzkvKLm.jpg','/storage/uploads/articles/thumbnails/1765448807_aBfpzkvKLm_thumb.jpg','Balongbendo — Sentuhan kepedulian kembali dihadirkan oleh LAZISNU MWCNU Balongbendo. Pada Rabu, 11 Desember 2025, pukul 11.50 WIB, tim LAZISNU bergerak cepat menuju rumah keluarga Bapak Zuhri dan Ibu Muliatin di Dusun Temenggungan RT 14 RW 04, Desa Balongbendo. Tujuan kedatangan mereka adalah satu: menyerahkan bantuan kursi roda untuk Adek Ozzi, bocah empat tahun yang sejak lahir berjuang melawan gangguan syaraf otak.','<p>Balongbendo — Sentuhan kepedulian kembali dihadirkan oleh LAZISNU MWCNU Balongbendo. Pada Rabu, 11 Desember 2025, pukul 11.50 WIB, tim LAZISNU bergerak cepat menuju rumah keluarga Bapak Zuhri dan Ibu Muliatin di Dusun Temenggungan RT 14 RW 04, Desa Balongbendo. Tujuan kedatangan mereka adalah satu: menyerahkan bantuan kursi roda untuk Adek Ozzi, bocah empat tahun yang sejak lahir berjuang melawan gangguan syaraf otak.</p><p><br></p><p>Kedatangan tim LAZISNU dipimpin langsung oleh Ketua LAZISNU MWCNU Balongbendo, Bapak M. Nurhadi, didampingi pengurus ranting, Bapak Arifin, serta tokoh masyarakat setempat, Bapak Supriadi. Suasana penuh haru menyelimuti rumah sederhana itu ketika kursi roda diserahkan. Senyum kecil Ozzi menjadi penyemangat bagi semua yang hadir.</p><p><img src=\"https://nucarelazisnubalben.or.id/storage/uploads/images/1765448797_Ab3JUsDM2u.jpg\" data-editable=\"false\" style=\"position: relative; display: inline-block; margin: 10px; cursor: default; user-select: none; max-width: none; height: 1422.91px; width: 800px;\" draggable=\"false\"></p><p>Dalam sambutannya, Ketua LAZISNU MWCNU Balongbendo, Bapak M. Nurhadi, menegaskan bahwa bantuan ini adalah bentuk nyata dari amanah umat.</p><p>“LAZISNU akan selalu berupaya hadir untuk masyarakat. Kursi roda ini semoga menjadi wasilah keringanan bagi keluarga, serta menambah semangat bagi adik Ozzi dalam berjuang,” ujarnya. Pernyataan tersebut juga diperkuat oleh dukungan pengurus ranting, Bapak Arifin, yang menegaskan pentingnya gerak cepat dan ketepatan sasaran dalam setiap bantuan.</p><p><br></p><p>Rasa syukur mendalam disampaikan oleh orang tua Ozzi, Ibu Muliatin dan Bapak Zuhri. Dengan suara bergetar, mereka menceritakan perjuangan yang harus dilakukan dua kali dalam seminggu untuk membawa Ozzi ke RS CIKO guna kontrol di Poli Syaraf.</p><p>“Dengan kursi roda ini, perjalanan kami menjadi jauh lebih ringan. Kami sangat berterima kasih kepada LAZISNU. Bantuan ini benar-benar meringankan beban kami,” ungkap sang ibu penuh haru.</p><p><br></p><p>Penyerahan bantuan ini menjadi bukti nyata visi kemanusiaan LAZISNU NU Care Balongbendo yang terus digaungkan melalui motto “Satu Amanah, Sejuta Manfaat.” Melalui program-program sosialnya, LAZISNU berkomitmen memastikan setiap donasi yang dititipkan dapat memberikan manfaat sebesar-besarnya bagi masyarakat yang membutuhkan.</p><p><br></p><p>LAZISNU Balongbendo juga terus membuka kesempatan bagi para dermawan yang ingin berbagi. Setiap infak, sedekah, dan donasi akan dikelola secara profesional dan disalurkan kepada warga yang layak dan berhak menerima.</p><p><br></p><p>Kisah kecil dari rumah Bapak Zuhri ini mengingatkan bahwa kepedulian bukan sekadar bantuan material, tetapi juga harapan baru bagi mereka yang sedang berjuang. LAZISNU Balongbendo hadir memastikan bahwa harapan itu tetap menyala.</p>','2025-12-11 17:24:00',1,272,'2025-12-11 10:26:47','2026-01-16 03:48:07'),
(8,4,4,'Silaturahmi dan Kajian Kitab LAZISNU Balongbendo Teguhkan Ukhuwah dan Tradisi Keilmuan','silaturahmi-dan-kajian-kitab-lazisnu-balongbendo-teguhkan-ukhuwah-dan-tradisi-keilmuan','MISBAKHUL MUNIR','/storage/uploads/articles/1765720606_SkSYOnKAnd.jpg','/storage/uploads/articles/thumbnails/1765720606_SkSYOnKAnd_thumb.jpg','Balongbendo — LAZISNU MWCNU Balongbendo menyelenggarakan kegiatan rutin satu bulan sekali Silaturahmi dan Kajian Kitab Sulam Taufiq','<p><strong>Balongbendo</strong> — LAZISNU MWCNU Balongbendo menyelenggarakan kegiatan rutin satu bulan sekali Silaturahmi dan Kajian Kitab Sulam Taufiq pada Ahad, 14 Desember 2025, bertempat di Balai Desa Balongbendo. Kegiatan ini diikuti oleh seluruh pengurus LAZISNU tingkat MWC dan ranting, para donatur, serta jamaah se-Kecamatan Balongbendo.</p><p><br></p><p>Rangkaian kegiatan diawali dengan khotmil Qur’an dan pembacaan sholawat Nabi Muhammad SAW, sebagai ikhtiar menumbuhkan keberkahan dan memperkuat kecintaan kepada Al-Qur’an dan Rasulullah. Acara dilanjutkan dengan kajian Kitab Sulam Taufiq yang diasuh oleh Yai Sa’dul Kholis, sebagai penguatan dasar-dasar akidah, ibadah, dan akhlak Ahlussunnah wal Jama’ah.</p><p><br></p><p>Dalam sambutannya, Kepala Desa Balongbendo, H. Sumanto, S.Pd, mengapresiasi peran LAZISNU yang konsisten menghadirkan kegiatan keagamaan di tengah masyarakat. Menurutnya, sinergi antara lembaga keagamaan dan pemerintah desa sangat penting dalam membangun masyarakat yang religius, harmonis, dan memiliki kepedulian sosial.</p><p><br></p><p><img src=\"https://nucarelazisnubalben.or.id/storage/uploads/images/1765720553_0q6mlHi0zt.jpg\" data-editable=\"false\" style=\"position: relative; display: inline-block; margin: 10px; cursor: default; user-select: none; max-width: none; height: 450px; width: 800px;\" draggable=\"false\"></p><p>Ketua MWC NU Balongbendo, KH. Abdurrahman, M.Ag, menegaskan bahwa LAZISNU memiliki peran strategis, tidak hanya dalam pengelolaan zakat, infak, dan sedekah, tetapi juga dalam menjaga dan menghidupkan tradisi keilmuan Islam. Kajian kitab dinilai sebagai bagian penting dari dakwah NU untuk membekali umat dengan pemahaman keagamaan yang lurus dan moderat.</p><p><br></p><p><img src=\"https://nucarelazisnubalben.or.id/storage/uploads/images/1765720564_BQEKVi2iPo.jpg\" data-editable=\"false\" style=\"position: relative; display: inline-block; margin: 10px; cursor: default; user-select: none; max-width: none; height: 450px; width: 800px;\" draggable=\"false\"></p><p>Sementara itu, Ketua LAZISNU MWCNU Balongbendo, Bapak Nurhadi, menyampaikan terima kasih kepada seluruh pengurus dan donatur atas kepercayaan serta partisipasi yang terus terjaga. Ia menekankan bahwa kekuatan LAZISNU terletak pada kebersamaan dan keikhlasan, serta berharap kegiatan silaturahmi dan kajian kitab ini dapat menjadi agenda rutin yang memperkuat amanah pengelolaan dana umat.</p><p><br></p><p>Menutup rangkaian sambutan, Rais Syuriyah Ranting Balongbendo, H. Usman Sholeh, mengajak seluruh hadirin untuk terus istiqamah dalam menuntut ilmu. Ia menegaskan bahwa kajian Kitab Sulam Taufiq merupakan pondasi penting dalam membentuk pribadi muslim yang kokoh akidahnya, tertib ibadahnya, dan mulia akhlaknya.</p><p><br></p><p><img src=\"https://nucarelazisnubalben.or.id/storage/uploads/images/1765720602_rEkbxyqVeP.jpg\" data-editable=\"false\" style=\"position: relative; display: inline-block; margin: 10px; cursor: default; user-select: none; max-width: none; height: 450px; width: 800px;\" draggable=\"false\"></p><p>Selain kajian dan silaturahmi, kegiatan ini juga diramaikan dengan pembagian sayur gratis bagi para jamaah yang hadir, sebagai bentuk pemberdayaan dan kebersamaan jamaah. Melalui kegiatan ini, LAZISNU MWCNU Balongbendo berharap dapat terus menghadirkan majelis ilmu yang bermanfaat, menumbuhkan kesadaran berzakat dan bersedekah, serta memperkuat peran dakwah sosial demi kemaslahatan umat.</p>','2025-12-14 20:55:00',1,133,'2025-12-14 13:56:46','2026-01-09 14:41:06'),
(10,4,6,'LAZISNU MWC NU Balongbendo Galang Infaq Jum’at Peduli Bencana Sumatera, Respons Warga NU Sangat Luar Biasa','lazisnu-mwc-nu-balongbendo-galang-infaq-jumat-peduli-bencana-sumatera-respons-warga-nu-sangat-luar-biasa','MISBAKHUL MUNIR','/storage/uploads/articles/1766188431_aJppEwIoRU.jpg','/storage/uploads/articles/thumbnails/1766188431_aJppEwIoRU_thumb.jpg','Kepedulian terhadap sesama kembali ditunjukkan warga Nahdlatul Ulama di Kecamatan Balongbendo. Melalui Instruksi Infaq Jum’at Peduli Bencana Sumatera, LAZISNU MWC NU Balongbendo bersama','<p><strong>Balongbendo</strong>, - Kepedulian terhadap sesama kembali ditunjukkan warga Nahdlatul Ulama di Kecamatan Balongbendo. Melalui Instruksi Infaq Jum’at Peduli Bencana Sumatera, LAZISNU MWC NU Balongbendo bersama LTMNU dan LDNU menggerakkan penggalangan dana kemanusiaan yang dilaksanakan serentak pada Jum’at di seluruh masjid wilayah Balongbendo.</p><p><br></p><p>Kegiatan ini merupakan tindak lanjut dari instruksi PCNU Sidoarjo sebagai respons atas bencana besar yang melanda sejumlah wilayah di Indonesia, khususnya Sumatera dan Aceh. Infaq Jum’at diarahkan secara khusus untuk membantu para korban bencana sebagai wujud solidaritas dan ukhuwah Islamiyah.</p><p><img src=\"https://nucarelazisnubalben.or.id/storage/uploads/images/1766188328_f7p84X9dGV.jpg\" data-editable=\"false\" style=\"position: relative; display: inline-block; margin: 10px; cursor: default; user-select: none; max-width: none; height: 928.377px; width: 800px;\" draggable=\"false\"></p><p>Berdasarkan penelusuran Tim Media LAZISNU MWC NU Balongbendo, kegiatan penggalangan dana ini mendapatkan respon yang sangat luar biasa dari masyarakat. Antusiasme jamaah terlihat dari partisipasi aktif warga NU di berbagai masjid, yang dengan penuh keikhlasan menyisihkan sebagian rezekinya untuk saudara-saudara yang terdampak bencana.</p><p><br></p><p>Ketua LAZISNU MWC NU Balongbendo, M. Nurhadi, menyampaikan apresiasi setinggi-tingginya kepada seluruh warga NU dan masyarakat Balongbendo atas kepedulian yang ditunjukkan.</p><p><br></p><p><em>“Alhamdulillah, penggalangan infaq Jum’at Peduli Bencana ini berjalan dengan lancar dan mendapat respon yang luar biasa dari masyarakat. Ini membuktikan bahwa semangat gotong royong dan kepedulian sosial warga NU Balongbendo sangat kuat. Kami mengucapkan terima kasih kepada seluruh jamaah, takmir masjid, dan relawan yang telah berpartisipasi. Semoga setiap rupiah yang diinfakkan menjadi amal jariyah dan membawa manfaat besar bagi para korban bencana,” ungkapnya.</em></p><p><br></p><p>Sementara itu, Rais Syuriah MWCNU Balongbendo, KH. Ah. Miftahul Huda, menegaskan bahwa kegiatan ini merupakan bentuk nyata kehadiran NU di tengah umat.</p><p><br></p><p><em>“Alhamdulillah telah terlaksana penggalangan dana peduli bencana Sumatera dan Aceh yang dilaksanakan oleh LAZISNU bekerja sama dengan LTMNU. Ini adalah bukti kepedulian NU terhadap umat. Berapapun nilai donasi tidak menjadi soal, yang terpenting NU ada, NU bergerak, dan NU peduli. Terima kasih kepada semua pihak yang telah menyumbangkan pikiran, tenaga, dan materi. Semoga kita semua mendapatkan ridla Allah SWT. Aamiin,” tuturnya.</em></p><p><br></p><p>Hal senada disampaikan Ketua MWCNU Balongbendo, A. Abdul Rochman, M.Ag, yang menyampaikan bahwa kegiatan ini merupakan bentuk pelaksanaan instruksi organisasi.</p><p><br></p><p><em>“Alhamdulillah, hari ini kita telah melaksanakan instruksi dari PCNU Sidoarjo bekerja sama dengan LAZISNU, Takmir Masjid, dan LDNU di wilayah Balongbendo. Ini adalah ikhtiar untuk memperkuat ukhuwah Islamiyah dan wathaniyah, serta meneguhkan kepedulian umat Islam terhadap bencana yang terjadi di Sumatera, Aceh, hingga wilayah Semeru,” jelasnya.</em></p><p><br></p><p>Ia juga mengapresiasi soliditas seluruh elemen NU di Balongbendo.</p><p><br></p><p><em>“Kami menginstruksikan seluruh Banom dan ranting untuk melakukan penggalangan dana Peduli Bencana. Alhamdulillah, kegiatan ini terlaksana dengan maksimal. Terima kasih kepada seluruh pihak di bawah naungan MWC NU Balongbendo, khususnya LAZISNU MWC NU Balongbendo atas kerja samanya,” tambahnya.</em></p><p><br></p><p>Seluruh dana yang terkumpul dari kegiatan Infaq Jum’at Peduli Bencana ini selanjutnya akan ditasyarufkan melalui PCNU Sidoarjo untuk disalurkan kepada para korban bencana secara tepat sasaran dan akuntabel.</p><p><img src=\"https://nucarelazisnubalben.or.id/storage/uploads/images/1766188360_eiM8RL5GVS.jpg\" data-editable=\"false\" style=\"position: relative; display: inline-block; margin: 10px; cursor: default; user-select: none; max-width: none; height: 1063.34px; width: 800px;\" draggable=\"false\"></p><p>Kegiatan ini sekaligus menegaskan peran LAZISNU MWC NU Balongbendo sebagai garda terdepan dalam pelayanan sosial dan kemanusiaan, serta bukti bahwa NU senantiasa hadir, bergerak, dan peduli terhadap umat.</p><p><br></p><p>Satu Amanat, Sejuta Manfaat</p><p><br></p><p><img src=\"https://nucarelazisnubalben.or.id/storage/uploads/images/1766188425_caURFz4HbL.jpg\" data-editable=\"false\" style=\"position: relative; display: inline-block; margin: 10px; cursor: default; user-select: none; max-width: none; height: auto;\" draggable=\"false\"><img src=\"https://nucarelazisnubalben.or.id/storage/uploads/images/1766188391_2A0jmK9rmE.jpg\" data-editable=\"false\" style=\"position: relative; display: inline-block; margin: 10px; cursor: default; user-select: none; max-width: none; height: 450px; width: 800px;\" draggable=\"false\"></p>','2025-12-20 06:49:00',1,129,'2025-12-19 23:53:51','2026-01-16 03:47:29'),
(11,4,2,'Pengajian Isra Mi’raj di Masjid Miftahul Jannah Kemangsen Hadirkan Kyai Kondang','Hadirkan KH Anwar Zahid, Pengajian Akbar Isra Mi’raj di Kemangsen di Hadiri Ribuan Jamaah','MISBAKHUL MUNIR','/storage/uploads/articles/1768085831_BjT50XfyRE.jpg','/storage/uploads/articles/thumbnails/1768085831_BjT50XfyRE_thumb.jpg','Hadirkan KH Anwar Zahid, Pengajian Akbar Isra Mi’raj di Kemangsen di Hadiri Ribuan Jamaah','<p><strong>Balongbendo </strong>– Sabtu (10/1/2026), Masjid Miftahul Jannah, Dusun Pilang Bangu Selatan, Desa Kemangsen, Kecamatan Balongbendo, Kabupaten Sidoarjo, dipadati ribuan jamaah dalam kegiatan pengajian umum memperingati Isra Mi’raj Nabi Muhammad SAW. Kegiatan ini menjadi momentum spiritual sekaligus penguatan ukhuwah islamiyah di tengah masyarakat.</p><p><br></p><p>Pengajian yang dihadiri tokoh agama, pengurus lembaga NU, serta masyarakat umum ini diawali dengan khotmil Qur’an sejak pagi hari. Rangkaian acara kemudian dilanjutkan dengan pembacaan sholawat Nabi dan ayat suci Al-Qur’an yang berlangsung khidmat dan penuh kekhusyukan.</p><p><br></p><p>Ketua PHBI, Ustadz Suhariono, dalam sambutannya menyampaikan terima kasih kepada seluruh panitia dan masyarakat yang telah berpartisipasi menyukseskan kegiatan tersebut. Ia berharap peringatan Isra Mi’raj dapat menjadi agenda rutin tahunan sebagai sarana meningkatkan keteladanan akhlak Rasulullah SAW dalam kehidupan bermasyarakat.</p><p><br></p><p>Puncak acara diisi dengan tausiyah oleh kyai kondang KH Anwar Zahid dari Bojonegoro. Dalam ceramahnya, beliau menegaskan bahwa Isra Mi’raj merupakan pengingat pentingnya menjaga shalat, memanfaatkan waktu untuk ibadah, serta memperkuat kepedulian sosial antar sesama umat.</p><p><br></p><p>Acara ditutup dengan doa bersama dalam suasana aman dan kondusif.</p>','2026-01-11 05:54:00',0,25,'2026-01-10 22:57:12','2026-01-16 02:57:20');
