INSERT INTO `organization_settings` VALUES
(1,'welcome_message','Sambutan Ketua','Assalamu’alaikum warahmatullahi wabarakatuh.\r\n\r\nSegala puji bagi Allah SWT atas limpahan rahmat dan karunia-Nya sehingga LAZISNU Balongbendo dapat terus menjalankan amanah dalam memberikan pelayanan sosial, pendidikan, kesehatan, dan pemberdayaan kepada masyarakat. Dengan penuh rasa syukur, kami memperkenalkan website resmi ini sebagai langkah penting dalam meningkatkan transparansi, akuntabilitas, serta kemudahan akses informasi bagi masyarakat dan para dermawan. Kami berharap kehadiran platform ini dapat menjadi sarana untuk memperluas jangkauan program, menyampaikan laporan kegiatan secara lebih terbuka, serta memperkuat kolaborasi antara pengurus, relawan, donatur, dan seluruh mitra kebaikan. Terima kasih kami sampaikan kepada semua pihak yang telah mendukung terwujudnya inovasi ini. Semoga Allah SWT meridai setiap ikhtiar kita dalam menebarkan manfaat dan kebaikan bagi umat. \r\n\r\nWassalamu’alaikum warahmatullahi wabarakatuh.',NULL,NULL,'/storage/uploads/organization/chairman_1765378842_ZDWuYfao5K.jpg',1,1,'2025-12-10 14:42:16','2025-12-10 15:00:42'),
(2,'organization_structure','Struktur Organisasi',NULL,'{\"positions\":[{\"name\":\"M NURHADI\",\"title\":\"Ketua\",\"description\":\"\",\"order\":1,\"is_chairman\":true,\"photo\":null},{\"name\":\"WAHYUDI\",\"title\":\"wakil ketua 1\",\"description\":\"\",\"order\":2,\"is_chairman\":false,\"photo\":null},{\"name\":\"MOCH HASYIM ASHARI\",\"title\":\"WAKIL KETUA 2\",\"description\":\"\",\"order\":3,\"is_chairman\":false,\"photo\":null},{\"name\":\"WAKIL KETUA 3\",\"title\":\"NELY ISWATI\",\"description\":\"\",\"order\":4,\"is_chairman\":false,\"photo\":null},{\"name\":\"SITI MAS\'ULA\",\"title\":\"WAKIL KETUA 4\",\"description\":\"\",\"order\":5,\"is_chairman\":false,\"photo\":null},{\"name\":\"SANG HADIONO\",\"title\":\"SEKRETARIS\",\"description\":\"\",\"order\":6,\"is_chairman\":false,\"photo\":null},{\"name\":\"HARTINI\",\"title\":\"WAKIL SEKRETARIS 1\",\"description\":\"\",\"order\":7,\"is_chairman\":false,\"photo\":null},{\"name\":\"MURTININGSIH\",\"title\":\"WAKIL SEKRETARIS 2\",\"description\":\"\",\"order\":8,\"is_chairman\":false,\"photo\":null},{\"name\":\"SHOLIKHAH\",\"title\":\"WAKIL SEKRETARIS 3\",\"description\":\"\",\"order\":9,\"is_chairman\":false,\"photo\":null},{\"name\":\"M FAIQ AHMAD\",\"title\":\"WAKIL SEKRETARIS 4\",\"description\":\"\",\"order\":10,\"is_chairman\":false,\"photo\":null},{\"name\":\"HJ SITI UMROTUN\",\"title\":\"BENDAHARA 1\",\"description\":\"\",\"order\":11,\"is_chairman\":false,\"photo\":null},{\"name\":\"M CHABIB MUDOFAR\",\"title\":\"BENDAHARA 2\",\"description\":\"\",\"order\":12,\"is_chairman\":false,\"photo\":null},{\"name\":\"DIAN AGUS ROMADONI\",\"title\":\"HUMAS & PUBLIKASI\",\"description\":\"\",\"order\":13,\"is_chairman\":false,\"photo\":null}]}',NULL,NULL,1,2,'2025-12-10 14:43:06','2025-12-11 10:15:51');
