INSERT INTO `vision_mission_settings` VALUES
(1,'Menjadi lembaga amil zakat terpercaya yang menghadirkan kemandirian ekonomi umat melalui pemberdayaan berkelanjutan dan transparansi pengelolaan dana sosial.','1. Menghimpun, mengelola, dan menyalurkan zakat, infak, sedekah secara amanah dan profesional.\n2. Memberdayakan mustahik melalui program ekonomi produktif dan pendampingan usaha.\n3. Mengembangkan program sosial yang berdampak langsung pada peningkatan kesejahteraan masyarakat.\n4. Membangun jaringan kemitraan strategis untuk memperluas jangkauan program kemanusiaan.\n5. Menerapkan tata kelola organisasi yang transparan dan akuntabel.',NULL,1,'2025-12-10 14:41:57','2025-12-10 14:41:57');
